import React from "react";

function Home() {
  return (
    <div className="home">

        <div class="container">
                <div class="row align-items-center my-5">
                <div class="col-lg-1">
                    <img
                    class="img-fluid rounded mb-4 mb-lg-0"
                    src="http://placehold.it/900x400"
                    alt=""
                    />
                </div>
                <div class="col-lg-10">
                    <iframe title="docs" src="https://docs.google.com/document/d/e/2PACX-1vSQNqtJfC7sw5c_G4A7Epmm3eLIicW8TNyPuCJSUuZQBxa7qWsoY66zIKTq7LCmZi__7S9R5z_pCMfQ/pub?embedded=true" height = "1000px" width = "100%"></iframe>


                </div>
                </div>
            </div>


    </div>
  );
}

export default Home;
